import React, { useEffect, useState } from 'react';
import axios from 'axios';

function DataDisplay() {
  const [data, setData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Replace 'API_URL' with the actual URL of the API you want to fetch data from.
    const apiUrl = 'http://localhost:8000/api/countrydata/';

    axios.get(apiUrl)
      .then((response) => {
        setData(response.data);
        setIsLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
        setIsLoading(false);
      });
  }, []);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>JSON Data from API</h1>
      {data.map((item) => (
        <div key={item.id}>
          <h2>{item.CountryName}</h2>
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>Year</th>
                <th>Data</th>
              </tr>
            </thead>
            <tbody>
              {Object.entries(item.YearlyData).map(([year, value]) => (
                <tr key={year}>
                  <td>{year}</td>
                  <td>{value}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
}

export default DataDisplay;
